import React from "react";
import "./magicianProfile.css";

export default function ProfileImage() {
  return (
    <div class="row loggedin_user">
      <div class="col-sm-3 col-md-3">
        <div class="user_profile">
          <img src="../Images/Profile Image.png" />
        </div>
      </div>
    </div>
  );
}
